import './Experience.css';
import HTML from '../../assets/HTMLlogo.webp';
import CSS from '../../assets/CSS.png';
import JS from '../../assets/JS.png';
import ReactImg from '../../assets/React.png';
import Node from '../../assets/Node.svg';
import Django from '../../assets/DjangoLogo.png';
import Postgre from '../../assets/Postgre.png';
import Python from '../../assets/python.svg';

function Experience ()
{
    const handleToggleAccordion = () =>
    {
        const accordions = document.querySelectorAll('.accordion');
        accordions.forEach(accordion =>
            {
                const header = accordion.querySelector('.accordion-header');
                header.addEventListener('click',function()
                {
                    const content = document.querySelector('.accordion-content');
                    content.style.display = content.style.display === 'block' ? 'none' : 'block';
                })
            })
    }
    return (
        <div className="experience-container">
            <h1 className='title'>
                Experience
            </h1>
            <div className='professional-container'>
                <h1>
                    Professional
                </h1>
                <div className='accordion'>
                    <div className='accordion-header'>
                        <div className="main-head">
                            <div className="basic">
                                <h1 className="position">
                                    Full Stack Developer Intern
                                </h1>
                                <p className="company">
                                    GLogic
                                </p>
                                <p className="tenure">
                                    May 2023 - Present
                                </p>
                            </div>
                            <div className="company-logo-div">
                                <img className="company-logo" src={ReactImg} alt='company-logo'/>
                            </div>
                        </div>
                        <div className='tech-stack'>
                            <img className='tech-logo' src={ReactImg} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={Node} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={JS} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={HTML} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={CSS} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={Python} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={Django} alt='tech-stack-logo'/>
                            <img className='tech-logo' src={Postgre} alt='tech-stack-logo'/>
                        </div>
                    </div>
                    <div className="accordion-content">
                        <ul className="summary">
                            <li>
                                Deployed fully functional multi-input forms, lookup tables, and webpages for a web business automation platform used by healthcare clients using frameworks such as React, Node, and Django. 
                            </li>
                            <li>
                                Applied styles and event-driven functionality using HTML, CSS, and Javascript. Managed and uploaded application files and versions using Github.  Working on the development through Google Cloud Platform and Express JS.
                            </li>
                            <li>
                            Created new APIs using REST and Django methodologies alongside responding to and working on urgent requirements concerning locking form input fields and creating new tables in the database through DBeaver and PGAdmin.
                            </li>
                        </ul>
                    </div>
                </div>
                        {/*  */}
            </div>
        </div>
    );
}

export default Experience;
